import Item from "./Item";
function ItemList(props) {
    return(
        <div>
            {props.items.map(item => (
                <Item
                    key={item.id}
                    name={item.name}
                    price={item.price}
                    category={item.categorys}
                    />
    ))}

        </div>
    );

}

export default ItemList;
